import React from 'react';

const NavBar = () => {
    return (
        <React.Fragment>
            <nav id="navbar">
                <a href='/' id="logo">CurlyB</a>
                <div id="menu-container">
                    <ul id="menu-lists">
                        <li><a href='/' id="menu-item">Home</a></li>
                        <li><a href='/' id="menu-item">Blog</a></li>
                        <li><a href='/' id="menu-item">SignUp</a></li>
                        <li><a href='/' id="menu-item">SignIn</a></li>
                    </ul>
                </div>
            </nav>
        </React.Fragment>
    );
}

export default NavBar;
